import Issues from './service/Issues'
import './app.scss'
import { Link } from 'react-router-dom'

function App () {
  const nextPath = path => {
    this.props.history.push(path)
  }

  return (
    <div className='container'>
      <Link to="/create">
        <button className='btn btn-success'>Add Issue</button>
      </Link>
      <Issues />
    </div>
  )
}

export default App
